userDefinedLinkHintCss:
#vomnibar {
box-shadow: 0px 2px 10px rgb(0 0 0 / 17%);
margin: 0;
background: none;
font-family: system-ui;
border: 0;
}

#vomnibar .vomnibarSearchArea {
  background: none;
  border: 0;
  padding: 0;
}

#vomnibar input {
color: white;
background: #1b1b1b;
outline: none;
border: 0;
border-radius: 0;
font-weight: 300;
padding: 1em 12px;
}

#vomnibar ul {
background: #1b1b1b;
padding: 0;
margin: 0;
max-height: 450px;
}

#vomnibar li {
border: 0;
}

div.vimiumHintMarker {
    background: #000000a8 !important;
    padding: 4px !important;
border: 0 !important;
box-shadow: none;

}

#vomnibar li .vomnibarUrl,
div.vimiumHintMarker > span {
font-family: 'IBM Plex Mono';
}

#vomnibar li .vomnibarUrl {
color: #9e9e9e;
}


div.vimiumHintMarker > span {
color: white !important;
    font-size: 12px !important;
    font-weight: 500 !important;
    text-shadow: none !important; 
    text-transform: lowercase; 
font-family: 'IBM Plex Mono' !important;
}

#vomnibar li .vomnibarMatch, #vomnibar li em .vomnibarMatch, #vomnibar li .vomnibarTitle .vomnibarMatch {
 color: #fbffc9;
font-weight: bold;
}

div > .vimiumHintMarker > .matchingCharacter {
color: #4dffef !important;
}
#vomnibar li.vomnibarSelected {
background: #2f2f2f;
}

#vomnibar li .vomnibarIcon,
#vomnibar li .vomnibarSource.vomnibarNoInsertText {
  display: none;
}

#vomnibar li .vomnibarTopHalf {
  display: grid;
  grid-template-columns: minmax(30px, 60px) auto;
padding: 8px 5px;
}
#vomnibar li .vomnibarBottomHalf {
font-size: 10px;
padding: 0 5px;
}
#vomnibar li .vomnibarSource {
    color: #b7b7b7;
    margin-right: 4px;
    display: flex;
    line-height: 20px;
    font-size: 11px;
    background: #5a5a5a;
    justify-content: center;
    font-family: system-ui;
    padding: 0 6px !important;
    border-radius: 4px;
overflow: hidden;
}
#vomnibar li em, #vomnibar li .vomnibarTitle {
  font-size: 20px;
color: white;
font-weight: 300;
}
